const html = rankData.split("\n")
.map(line => line.split("\t"))
.map(datum => {
  const [views, subs, name, title, link, iconLink] = datum;
  const MIN_VIEWS = 5000;
  const point = parseFloat(views) / parseFloat(subs) * 100 * (Math.min(views, MIN_VIEWS) / MIN_VIEWS)**3;
  datum.push(point);

  return datum;
})
.sort((a, b) => b[6] - a[6])
.map((datum, i) => {
  const [views, subs, name, title, link, iconLink, point] = datum;

  return `
    <a class="mdl-list__item mdl-list__item--three-line mdl-shadow--2dp" href="${link}">
      <span class="mdl-list__item-primary-content">
        <img class="mdl-list__item-avatar" src="${iconLink}"></img>
        <span>${name}</span>
        <span class="mdl-list__item-text-body">${title}</span>
      </span>
      <span class="mdl-list__item-secondary-content">
        <span class="mdl-list__item-icon">${i + 1}</span>
        <span class="mdl-list__item-secondary-info">
          <span class="shiki">${views} views / ${subs} subs</span><br>
          ${point.toFixed(1)} %<br>
        </span>
      </span>
    </a>
  `;
})
.join("");
